import React from 'react';
import ChromeDinoGame from 'react-chrome-dino';

export default function QuatreCentQuatre() {
    return (
        <div className="notFound">
            <div className="notFound_title">404</div>
            <div className="notFound_subtitle">Page non trouvée</div>
            <div className="notFound_text">Désolé, la page que vous recherchez n'existe pas.</div>
            <button className="notFound_button" onClick={() => window.location.href = '/'}>Retourner à l'accueil</button>
        </div>
    );
}
